import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ScamChecker from './pages/ScamChecker';
import HelpAdvice from './pages/HelpAdvice'; // Fixed from HelpAndAdvice
import ScamTrends from './pages/ScamTrends';
import FraudContact from './pages/FraudContact'; // Fixed from FraudContacts

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<ScamChecker />} />
        <Route path="/help-advice" element={<HelpAdvice />} />
        <Route path="/scam-trends" element={<ScamTrends />} />
        <Route path="/fraud-contacts" element={<FraudContact />} /> {/* URL stays plural for user-friendliness */}
      </Routes>
    </Router>
  );
}

export default App;
